import './Home.css';
import logo from '../src/assets/logo.png'
import menu from '../src/assets/menu.png'


const Home = () => {
  return (
    <>
      <div className="header">
        <div className="blogo">
        <img style={{width:130,height:70,marginTop:-30,}} src={logo} alt="ss" />
         </div>
        <div className="search">
           <form>
           <select>
              <option>All</option>
              <option>Home and Garden</option>
              <option>Shoes</option>
              <option>Watches</option>
              <option>Electronics components</option>
            </select>
            <input type="text" placeholder="Search for products"></input>
            <button>Go</button><br></br><br></br>
              <a href="/#">Gift Shop</a>&nbsp;&nbsp;
              <a href="/#">Become a seller</a>&nbsp;&nbsp;
              <a href="/#">Special offers</a>&nbsp;&nbsp;
              <a href="/#">Buyer protection</a>
          </form>
        </div> 
        
        <div className="icons">
         
      <img style={{width:200,height:100}} src="..\bonzii\src\assets\logo.png" />
        </div>
</div>

{/* <div className="categoriess">
<img style={{width:30,height:20,marginTop:-30,paddingLeft:100,paddingTop:100}} src={menu} alt="ss" />&nbsp;
<span style={{paddingTop:68}}>Categories </span>
</div> */}
<div className="cat">
<img style={{width:30,height:20,paddingLeft:100,paddingTop:100}} src={menu} alt="ss" />&nbsp;&nbsp;  
</div>
    </>
  );
};

export default Home;
